Description:
============

Autoplay Menu Designer is a powerful tool that allows you to create beautiful and interactive autorun menus for CD-ROMs and other storage media (DVD, USB Flash drives), without any programming skills. Using a simple wizard to create autorun menus and a variety of occupational schemes, you can easily make a new, eye-catching design startup disk, which combines graphic shapes, buttons, and annotations.
Autoplay Menu Designer supports a wide range of actions that make the menu interactive. The user can click buttons or links to run applications, open documents, open the URL links, show or hide objects, play sound, change any of the visual properties of objects. The new project can be previewed at any time before final assembly package to make sure that the CD autorun menu works as required.



